import React, { Component } from 'react'
import BasePage from './BasePage'
import ProfileBlocksTeacher from '../components/ProfileBlocks/Teacher/ProfileBlocksTeacher/ProfileBlocksTeacher'
import Search from '../components/ProfileBlocks/Search/Search'

const [isSideMenuOpen, setIsSideMenuOpen] = useState(false);
const toggleMenu = () => {
  setIsSideMenuOpen(!isSideMenuOpen);
};

export default class ProfileTeacher extends Component {
  
  render() {
    const tableData = this.props.tableData
    return (
      <BasePage isAuthenticated={true} name={'Раевич Ксения Владиславовна'} toggleMenu={toggleMenu} isSideMenuOpen={isSideMenuOpen}>
         <Search />
    <ProfileBlocksTeacher tableData={tableData}/>
      </BasePage>
    )
  }
}
